function Faq() {
  return (
    <>
      <h1 style={faqStyles.h1}>FAQ</h1>
      <div style={faqStyles.videoCenter}>
        <iframe
          display="block"
          width="560"
          height="315"
          src="https://www.youtube.com/embed/llQJxq-_Qp8"
          title="YouTube video player"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </div>
      <div style={faqStyles.h1}>
        <div style={faqStyles.leftHalf}>
          <h1>iPhone Users</h1>
          <p>Download the iPhone app here.</p>
          <button href="#text-buttons">Iphone App</button>
        </div>

        <div style={faqStyles.leftHalf}>
          <h1>Android Users </h1>
          <p>Download the Android app here.</p>
          <button href="#text-buttons">Android App</button>
        </div>
      </div>
      &nbsp; &nbsp; &nbsp;
      <h1 style={faqStyles.h1}>Frequently Asked Questions</h1>
    </>
  );
}

export default Faq;

const faqStyles = {
  h1: {
    textAlign: "center",
  },
  videoCenter: {
    textAlign: "center",
  },
  leftHalf: {
    backgroundColor: "white",
    float: "left",
    width: "50%",
    padding: "5px 5px 5px 5px",
  },
  rightHalf: {
    backgroundColor: "white",
    float: "right",
    width: "50%",
    padding: "5px 5px 5px 5px",
  },
  container: {
    display: "flex",
    alignItems: "center",
    padding: 20,
    borderRadius: 20,
  },
};
